import { useCallback, useState } from "react";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

const initState = {
  content: "",
  money: [],
  choose: "",
};
const MoneyModifyComponent = () => {
  const [moneyParam, setMoneyParam] = useState({ ...initState });

  const handleChange = useCallback((e) => {
    moneyParam[e.target.name] = moneyParam[e.target.value];
    setMoneyParam({ ...moneyParam });
  });

  const handleSubmitMoney = () => {};

  return (
    <div className="container">
      <br />
      <br />

      <h4></h4>
      <hr />
      <br />
      <Form onSubmit={handleSubmitMoney}>
        <Form.Group className="mb-3">
          <Form.Label>수입*지출내용</Form.Label>
          <Form.Check
            inline
            type="radio"
            label="수입"
            name="choose"
            value="1"
          />
          <Form.Check
            inline
            type="radio"
            label="지출"
            value="2"
            name="choose"
          />
          <Form.Control
            type="text"
            name="content"
            value={moneyParam.content}
            onChange={handleChange}
          />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>닉네임</Form.Label>
          <Form.Control
            type="number"
            name="money"
            value={moneyParam.money}
            onChange={handleChange}
          />
          (단위:원)
        </Form.Group>
        {/* 
        <Form.Group className="mb-3">
          <Form.Label>닉네임</Form.Label>
          <Form.Control
            type="text"
            name="nick"
            value={joinParam.nick}
            onChange={handleChange}
          />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group> */}

        {/* <Form.Group className="mb-3" >
         <Form.Check type="checkbox" label="Check me out" />
        </Form.Group>  */}

        <Button variant="primary" type="submit">
          수입&지출등록
        </Button>
      </Form>
    </div>
  );
};

export default MoneyModifyComponent;
